    def __init__(self, N: int, M: int):
        self.N = N
        self.M = M
        self.points = {'Anthony': 0, 'Cora': 0}

    def update_points(self, winner: str) -> None:
        if self.points[winner] == 0:
            self.points[winner] = self.N + self.M - 1
        else:
            self.points[winner] += 1

    def play_game(self, prob: float) -> None:
        N = self.N
        M = self.M
        while self.points['Anthony'] > 0 and self.points['Cora'] > 0:
            loser = 'Anthony' if random() < prob else 'Cora'
            self.update_points(loser)
            if random() < prob:
                self.update_points('Anthony')
            else:
                self.update_points('Cora')

    def solve(self) -> float:
        prob = 0.5
        for i in range(1, 101):
            self.play_game(prob)
            if self.points['Anthony'] == 0:
                prob *= 0.99
            elif self.points['Cora'] == 0:
                prob *= 1.01
        return prob

