class Solution:
    def solution(self, stdin: str) -> str:
        n, m = map(int, stdin.split())
        toys = [tuple(map(int, toy.split())) for toy in stdin.split("\n")[1:n+1]]
        trees = [tuple(map(int, tree.split())) for tree in stdin.split("\n")[n+1:]]

        def shortest_distance(x, y):
            return min(abs(x - dx) + abs(y - dy) for dx, dy in [(1, 0), (0, 1), (-1, 0), (0, -1)])

        def closest_toy(x, y):
            return min(toys, key=lambda t: shortest_distance(t[0], t[1]) if shortest_distance(x, y) < shortest_distance(t[0], t[1]) else float('inf'))

        def closest_tree(x, y):
            return min(trees, key=lambda t: shortest_distance(t[0], t[1]) if shortest_distance(x, y) < shortest_distance(t[0], t[1]) else float('inf'))

        def closest_unchewed_toy(x, y):
            return min(toys, key=lambda t: t[2] if t[0] == x and t[1] == y else float('inf'))

        def closest_unchewed_tree(x, y):
            return min(trees, key=lambda t: t[2] if t[0] == x and t[1] == y else float('inf'))

        def find_closest_position(x, y, toy, tree):
            return (closest_toy(x, y) if closest_toy(x, y) == toy else (closest_tree(x, y) if closest_tree(x, y) == tree else (closest_unchewed_toy(x, y) if closest_unchewed_toy(x, y) == toy else closest_unchewed_tree(x, y))))) if shortest_distance(x, y) < shortest_distance(closest_toy(x, y).x, closest_toy(x, y).y) else (closest_toy(x, y) if closest_toy(x, y) == toy else closest_tree(x, y) if closest_tree(x, y) == tree else closest_unchewed_toy(x, y) if closest_unchewed_toy(x, y) == toy else closest_unchewed_tree(x, y)))

        leash = (x, y) = (0, 0)
        leash_length = 0
        toys_completed = 0

        while toys_completed < n:
            closest_position = find_closest_position(leash[0], leash[1], closest_unchewed_toy(leash[0], leash[1])[0], closest_unchewed_toy(leash[0], leash[1])[1])
            closest_position_length = shortest_distance(leash[0], leash[1]) + shortest_distance(closest_position.x, closest_position.y)
            if leash_length + closest_position_length < 0.001:
                toys_completed += 1
            leash = (closest_position.x, closest_position.y)
            leash_length += closest_position_length

        return f"{leash_length:.2f}"

